import Link from "next/link";
import Image from "next/image";

const HeaderNuevo = () => {
  return (
    <>
      <nav className="navbar-yesmom">
      <div className="burger-yesmom">
          <Image
            src="/image/header/burger.svg"
            alt="burger yesmom"
            width={50}
            height={50}
            // layout="intrinsic"
          />
        </div>
        <Link href="/">
          <a>
            <Image
              src="/image/header/logo-yesmom.svg"
              alt="logo yesmom"
              width={70}
              height={70}
            />
          </a>
        </Link>
        <div>
            <div>
                <Link href="/blog">
                <a>
                <figure className="item-menu ">
                      <Image
                        src="/image/header/blog.svg"
                        alt="logo blog yesmom "
                        //   className="lupa-img"
                        width={70}
                        height={70}
                      />
                    </figure>
                    <h6 className="">Blog</h6>
                </a>
                </Link>
            </div>
        </div>

      </nav>
      <style jsx>
        {`
          .navbar-yesmom {
            display: flex;
            align-items: center;
            flex-wrap: wrap;
            padding: 1rem 4rem;
          }
          .burger-yesmom {
            margin-right: auto;
            display: none
            }
          }
          @media (max-width: 992px) {
            .burger-yesmom {
                display: block
            }
            .navbar-yesmom {
            padding: .5rem 1rem;
          }
          }

        `}
      </style>
    </>
  );
};

export default HeaderNuevo;
